import React from 'react';
import './Header.css';

export default class Header extends React.Component {
  render() {
    return (
      <header className='header'>
        <div className='flex'>
          <div className='gap'></div>
          <div className='gap'></div>
          <div className='gap'></div>
          <div className='gap'></div>
          <div className='gap'></div>
        </div>
      </header>
    );
  }
}
